				<div class="elementor-element elementor-element-9b37284 elementor-widget elementor-widget-text-editor" data-id="9b37284" data-element_type="widget" data-widget_type="text-editor.default">
				<div class="elementor-widget-container">
					<div class="elementor-text-editor elementor-clearfix"><p>Challenge Katta is hosting a technical Quiz competition where you get self-analysis of your technical knowledge. And also get a winning prizes. In this Quiz competitions, you can compete with quizzes on multiple domain and technologies.</p><p>Challenge Katta announces its first series of online recommendation of your skill improvements area that would help you for unlocking knowledge with the speed of thought.</p><p><strong>Who can apply: Any one can participate</strong></p><p><strong>Winning Prize:</strong></p><p><strong>Winner: Rs.5000/-        Runner-up: Rs.3000/-         2<sup>nd</sup> Runner-up: Rs.2000/-</strong></p><p><strong> </strong><strong>E-Certification will be provide to all participant</strong></p></div>
