				<div class="elementor-element elementor-element-eca2a10 elementor-widget elementor-widget-accordion" data-id="eca2a10" data-element_type="widget" data-widget_type="accordion.default">
				<div class="elementor-widget-container">
					<div class="elementor-accordion" role="tablist">
							<div class="elementor-accordion-item">
					<div id="elementor-tab-title-2481" class="elementor-tab-title" data-tab="1" role="tab" aria-controls="elementor-tab-content-2481">
													<span class="elementor-accordion-icon elementor-accordion-icon-left" aria-hidden="true">
															<span class="elementor-accordion-icon-closed"><i class="fas fa-plus"></i></span>
								<span class="elementor-accordion-icon-opened"><i class="fas fa-minus"></i></span>
														</span>
												<a class="elementor-accordion-title" href="">How to To Conduct Technical Quiz Competitions </a>
					</div>
					<div id="elementor-tab-content-2481" class="elementor-tab-content elementor-clearfix" data-tab="1" role="tabpanel" aria-labelledby="elementor-tab-title-2481"><ul><li>Consists of 70 questions asked randomly to all the participants, the participant has solve the quiz.</li><li>Every question carries 10 marks and <u>5 negative marks</u> for wrong answer</li><li>Time will be 60 min.</li><li>Results of the Quiz will be announced at the event date also notified on your email.</li><li>Quiz you can select as per given list below.</li></ul></div>
				</div>
							<div class="elementor-accordion-item">
					<div id="elementor-tab-title-2482" class="elementor-tab-title" data-tab="2" role="tab" aria-controls="elementor-tab-content-2482">
													<span class="elementor-accordion-icon elementor-accordion-icon-left" aria-hidden="true">
															<span class="elementor-accordion-icon-closed"><i class="fas fa-plus"></i></span>
								<span class="elementor-accordion-icon-opened"><i class="fas fa-minus"></i></span>
														</span>
												<a class="elementor-accordion-title" href="">Important Guidelines</a>
					</div>
					<div id="elementor-tab-content-2482" class="elementor-tab-content elementor-clearfix" data-tab="2" role="tabpanel" aria-labelledby="elementor-tab-title-2482"><ul><li>Format of Quiz: Quiz will be take place online, the participant can give this exam from their home or hostel with the use of a Laptop or PC or Mobile Phone.</li><li>You can attempt the quiz only once with single order ID.</li><li>All Questions are of Multiple Choice.</li><li>There is no restriction for how many attempt you participate the Quiz(As Many as you attempt, your score board added extra the points).</li></ul></div>
				</div>
							<div class="elementor-accordion-item">
					<div id="elementor-tab-title-2483" class="elementor-tab-title" data-tab="3" role="tab" aria-controls="elementor-tab-content-2483">
													<span class="elementor-accordion-icon elementor-accordion-icon-left" aria-hidden="true">
															<span class="elementor-accordion-icon-closed"><i class="fas fa-plus"></i></span>
								<span class="elementor-accordion-icon-opened"><i class="fas fa-minus"></i></span>
														</span>
												<a class="elementor-accordion-title" href="">How To Participate</a>
					</div>
					<div id="elementor-tab-content-2483" class="elementor-tab-content elementor-clearfix" data-tab="3" role="tabpanel" aria-labelledby="elementor-tab-title-2483"><ol><li>Go to the Challenger dashboard to attempt the Quiz</li><li>Click on your registered Quiz under Test Name.</li><li>Click Start Test to attempt the quiz.</li><li>The time will start the moment you click the Start Test button.</li><li>You can resume this quiz, if interrupted due to any reason.</li><li>Click on Next button to move next question.</li><li>Click on Submit Test button on completion of the quiz.</li></ol><p><strong>Result and Scoreboard will display after 24 Hr. as quiz done. </strong></p></div>
